import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import authService from "../../services/authService";

const Register = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    first_name: "",
    last_name: "",
    email: "",
    mobile_number: "",
    password: "",
    confirmPassword: "",
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validate mật khẩu
    if (form.password !== form.confirmPassword) {
      alert("❌ Mật khẩu không khớp!");
      return;
    }

    // Validate độ dài mật khẩu
    if (form.password.length < 6) {
      alert("❌ Mật khẩu phải có ít nhất 6 ký tự!");
      return;
    }

    try {
      // ✅ Chuẩn hóa dữ liệu theo API yêu cầu
      const payload = {
        firstName: form.first_name.trim(),
        lastName: form.last_name.trim(),
        email: form.email.trim(),
        password: form.password,
        mobileNumber: form.mobile_number.trim(),
        role: {
          roleName: "USER",
        },
        address: {
          street: "Default Street",
          city: "Hanoi",
          state: "HN",
          country: "VN",
          pincode: "100000",
          buildingName: "Building A",
        },
        cart: {
          totalPrice: 0,
          products: [],
        },
      };

      const res = await authService.register(payload);
      console.log("REGISTER RESULT:", res.data);

      alert("✅ Đăng ký thành công!");
      navigate("/login");
    } catch (error) {
      console.error("REGISTER ERROR:", error.response?.data || error.message);
      alert("❌ Đăng ký thất bại: " + (error.response?.data?.message || "Vui lòng kiểm tra lại thông tin!"));
    }
  };

  return (
    <section className="section-content padding-y">
      <div
        className="card mx-auto shadow"
        style={{ maxWidth: "520px", marginTop: "40px" }}
      >
        <article className="card-body">
          <header className="mb-4 text-center">
            <h4 className="card-title">Sign up</h4>
          </header>

          <form onSubmit={handleSubmit}>
            {/* Tên */}
            <div className="form-row">
              <div className="col form-group">
                <label>First name</label>
                <input
                  name="first_name"
                  type="text"
                  className="form-control"
                  value={form.first_name}
                  onChange={handleChange}
                  required
                  placeholder="Nhập tên"
                />
              </div>
              <div className="col form-group">
                <label>Last name</label>
                <input
                  name="last_name"
                  type="text"
                  className="form-control"
                  value={form.last_name}
                  onChange={handleChange}
                  required
                  placeholder="Nhập họ"
                />
              </div>
            </div>

            {/* Email */}
            <div className="form-group">
              <label>Email</label>
              <input
                name="email"
                type="email"
                className="form-control"
                value={form.email}
                onChange={handleChange}
                required
                placeholder="example@email.com"
              />
            </div>

            {/* Số điện thoại */}
            <div className="form-group">
              <label>Mobile number</label>
              <input
                name="mobile_number"
                type="tel"
                className="form-control"
                value={form.mobile_number}
                onChange={handleChange}
                placeholder="Nhập số điện thoại"
              />
            </div>

            {/* Mật khẩu */}
            <div className="form-row">
              <div className="form-group col-md-6">
                <label>Password</label>
                <input
                  name="password"
                  type="password"
                  className="form-control"
                  value={form.password}
                  onChange={handleChange}
                  required
                  minLength="6"
                  placeholder="Ít nhất 6 ký tự"
                />
              </div>
              <div className="form-group col-md-6">
                <label>Repeat password</label>
                <input
                  name="confirmPassword"
                  type="password"
                  className="form-control"
                  value={form.confirmPassword}
                  onChange={handleChange}
                  required
                  placeholder="Nhập lại mật khẩu"
                />
              </div>
            </div>

            <button type="submit" className="btn btn-primary btn-block">
              Register
            </button>
          </form>
        </article>
      </div>

      <p className="text-center mt-4">
        Have an account? <Link to="/login">Log In</Link>
      </p>
    </section>
  );
};

export default Register;
